import React, { FC, useState } from "react"


interface IParamsProps {
    fuel: string;
    damage: string;
}

const Query: FC = ():JSX.Element=>{
    const [params, setParmas] = useState<IParamsProps>({
        fuel: '',
        damage: ''
    })
    return(
        <div>
            <p><b>Search</b></p>
            <form action="">
                <label htmlFor="">Fuel({'<'}%)</label>
                <input type="text" value={params.fuel}/>
            </form>
            <form action="">
                <label htmlFor="">Damage({'>'}%)</label>
                <input type="text" value={params.damage}/>
            </form>
            <button>search</button>
            <button>reset</button>
            <button>add</button>
        </div>
    )
}
export default Query;
